import { useEffect, useState } from "react";
import CatCard from "./CatCard";

export default function CatCardList({ searchTerm }) {

  const [cats, setCats] = useState([]);
  useEffect(() => {
    fetch(`https://api.thecatapi.com/v1/images/search?limit=9&breed_ids=&api_key=live_EtG045ZWeV59PcqZyf63f4bfi5TNmsqqiOr97leiXJNkDidsHPVsELqT4Mc1fsZ1`)
      .then((response) => response.json())
      .then((data) => {
        setCats(data);
      });
  }, []);
  return (
    <div>
      {cats.map((cat) => {
        return <CatCard key={cat.id} cat={cat} />;
      })}
    </div>
  );
}
